        animation: 1.5s forwards text-show, 0s forwards overflow-visible;
        animation-delay: 2.8s, 4.5s;
        overflow: hidden;
    }

    #logo-text {
        overflow: visible;
        margin-left: 15px;
    }

    #text2, #text3, #text4 {
        opacity: 0;
        animation: 2s forwards text-opacity;
        animation-delay: 4.5s;
    }

    #text1 path {
        animation: 2.5s infinite bounce;
    }

    #text1 path:nth-of-type(1) { animation-delay:   4s; }
    #text1 path:nth-of-type(2) { animation-delay:   4.5s; }
    #text1 path:nth-of-type(3) { animation-delay:   4.1s; }
    #text1 path:nth-of-type(4) { animation-delay:   4.45s; }
    #text1 path:nth-of-type(5) { animation-delay:   4.15s; }
    #text1 path:nth-of-type(6) { animation-delay:   4.4s; }
    #text1 path:nth-of-type(7) { animation-delay:   4.2s; }
    #text1 path:nth-of-type(8) { animation-delay:   4.35s; }
    #text1 path:nth-of-type(9) { animation-delay:   4.25s; }
    #text1 path:nth-of-type(10) { animation-delay:  4.3s; }

    @keyframes text-show {
        0% { width: 0px; }
        100% { width: 315px; }
    }

    @keyframes overflow-visible {
        0% { overflow: hidden; }
        100% { overflow: visible; }
