</style>
<script>
    document.body.style.overflow = 'hidden';

    window.onload = (event) => {
        const preloader = document.querySelector('.preloader');

        setTimeout(function () {
            preloader.style.opacity = 0;

            setTimeout(function () {
                preloader.style.display = 'none';
                document.body.style.overflow = 'auto';
            }, 250);
        }, 250);
    };
</script>